import React, { useState } from 'react';
import './Areas.css';

const Areas = () => {
  const [hoveredArea, setHoveredArea] = useState(null);

  const districts = [
    { id: 'garbsen', name: 'Garbsen', type: 'surrounding' },
    { id: 'langenhagen', name: 'Langenhagen', type: 'surrounding' },
    { id: 'isernhagen', name: 'Isernhagen', type: 'surrounding' },
    { id: 'laatzen', name: 'Laatzen', type: 'surrounding' },
    { id: 'sehnde', name: 'Sehnde', type: 'surrounding' },
    { id: 'gehrden', name: 'Gehrden', type: 'surrounding' },
    { id: 'lehrte', name: 'Lehrte', type: 'surrounding' }
  ];

  const hanoverDistricts = [
    'Mitte', 'Vahrenwald-List', 'Bothfeld-Vahrenheide', 'Buchholz-Kleefeld',
    'Misburg-Anderten', 'Kirchrode-Bemerode-Wülferode', 'Südstadt-Bult',
    'Döhren-Wülfel', 'Ricklingen', 'Ahlem-Limmer', 'Linden-Limmer',
    'Nord', 'Herrenhausen-Stöcken'
  ];

  return (
    <section className="areas section" id="verteilgebiete">
      <div className="container">
        <h2 className="section-title">Verteilgebiete</h2>
        <p className="section-subtitle">Einsatzgebiete in der Region Hannover</p>
        
        <div className="areas-content">
          <div className="map-container">
            <div className="map-wrapper">
              <svg viewBox="0 0 1000 800" xmlns="http://www.w3.org/2000/svg">
                {/* Garbsen */}
                <path
                  id="garbsen"
                  d="M 180,250 L 250,200 L 310,220 L 330,280 L 320,340 L 280,360 L 220,340 L 180,300 Z"
                  className={`district-path surrounding ${hoveredArea === 'garbsen' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('garbsen')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="250" y="280" className="district-label">Garbsen</text>

                {/* Langenhagen */}
                <path
                  id="langenhagen"
                  d="M 330,160 L 420,140 L 480,170 L 490,230 L 450,270 L 380,280 L 330,250 L 320,200 Z"
                  className={`district-path surrounding ${hoveredArea === 'langenhagen' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('langenhagen')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="400" y="210" className="district-label">Langenhagen</text>

                {/* Isernhagen */}
                <path
                  id="isernhagen"
                  d="M 490,230 L 560,210 L 620,240 L 630,290 L 600,330 L 540,340 L 490,310 L 480,260 Z"
                  className={`district-path surrounding ${hoveredArea === 'isernhagen' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('isernhagen')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="550" y="280" className="district-label">Isernhagen</text>

                {/* Lehrte */}
                <path
                  id="lehrte"
                  d="M 650,320 L 740,310 L 800,360 L 810,430 L 770,480 L 690,490 L 640,460 L 630,390 Z"
                  className={`district-path surrounding ${hoveredArea === 'lehrte' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('lehrte')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="720" y="400" className="district-label">Lehrte</text>

                {/* Sehnde */}
                <path
                  id="sehnde"
                  d="M 620,480 L 690,490 L 720,540 L 710,600 L 660,630 L 590,620 L 560,570 L 580,510 Z"
                  className={`district-path surrounding ${hoveredArea === 'sehnde' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('sehnde')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="640" y="560" className="district-label">Sehnde</text>

                {/* Laatzen */}
                <path
                  id="laatzen"
                  d="M 440,560 L 520,550 L 560,580 L 560,630 L 520,670 L 450,670 L 410,630 L 420,580 Z"
                  className={`district-path surrounding ${hoveredArea === 'laatzen' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('laatzen')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="480" y="620" className="district-label">Laatzen</text>

                {/* Gehrden */}
                <path
                  id="gehrden"
                  d="M 200,480 L 270,470 L 310,500 L 310,550 L 280,590 L 220,590 L 180,550 L 190,510 Z"
                  className={`district-path surrounding ${hoveredArea === 'gehrden' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('gehrden')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="250" y="530" className="district-label">Gehrden</text>

                {/* Hannover Center (all districts combined) */}
                <path
                  id="hannover"
                  d="M 330,280 L 450,270 L 540,340 L 600,370 L 620,440 L 580,510 L 520,550 L 440,560 L 380,560 L 310,540 L 280,500 L 270,440 L 280,360 Z"
                  className={`district-path hannover ${hoveredArea === 'hannover' ? 'active' : ''}`}
                  onMouseEnter={() => setHoveredArea('hannover')}
                  onMouseLeave={() => setHoveredArea(null)}
                />
                <text x="420" y="420" className="district-label-main">HANNOVER</text>
              </svg>

              {/* Hover Info Card */}
              {hoveredArea && (
                <div className="hover-info-card">
                  {hoveredArea === 'hannover' ? (
                    <>
                      <h4>Stadt Hannover</h4>
                      <p className="info-subtitle">Alle Stadtteile:</p>
                      <div className="district-list">
                        {hanoverDistricts.map((district, idx) => (
                          <span key={idx} className="district-tag">{district}</span>
                        ))}
                      </div>
                    </>
                  ) : (
                    <>
                      <h4>{districts.find(d => d.id === hoveredArea)?.name}</h4>
                      <p>Umland • Vollständige Abdeckung</p>
                    </>
                  )}
                </div>
              )}
            </div>

            <div className="map-legend">
              <div className="legend-item">
                <div className="legend-color hannover-color"></div>
                <span>Stadt Hannover (13 Stadtteile)</span>
              </div>
              <div className="legend-item">
                <div className="legend-color surrounding-color"></div>
                <span>Umland & Region</span>
              </div>
            </div>
          </div>

          <div className="areas-note">
            <div className="note-box">
              <h3>Umland & Region</h3>
              <p>
                Sowie Garbsen, Langenhagen, Laatzen, Lehrte, Sehnde, Gehrden, Isernhagen und das gesamte Umland von Hannover.
              </p>
              <p>
                Wir decken die gesamte Region Hannover flächendeckend ab und garantieren eine 
                zuverlässige Zustellung in allen Gebieten.
              </p>
              <div className="coverage-stats">
                <div className="stat-item">
                  <div className="stat-number">13</div>
                  <div className="stat-label">Stadtteile</div>
                </div>
                <div className="stat-item">
                  <div className="stat-number">7+</div>
                  <div className="stat-label">Umlandgemeinden</div>
                </div>
                <div className="stat-item">
                  <div className="stat-number">100%</div>
                  <div className="stat-label">Abdeckung</div>
                </div>
              </div>
